import React from 'react'
import { useNavigate, useParams } from 'react-router-dom'

function Dashboard() {
  let navigate = useNavigate();
    return (
    <div>
        <h1>Dashboard</h1>
        <button
            onClick={() => {
                navigate("/submissions")
            }}
        > 
            Go to submissions 
        </button>
    </div>
  )
}

export default Dashboard;
